import React from "react";


const Logout = () => {
    const onSubmitDelete = () => {
        localStorage.clear();
        history.go("/login");
    }

    return(
        <div>
            <button onClick={ () => onSubmitDelete } >Logout</button>
        </div>
    )
}



export default Logout;
